public class InnerTaskDefinitionContainerDefinitionFactory(Action<Humidifier.ECS.TaskDefinitionTypes.ContainerDefinition> factoryAction = null) : SubResourceFactory<Humidifier.ECS.TaskDefinitionTypes.ContainerDefinition>
{

    internal InnerTaskDefinitionHealthCheckFactory HealthCheckFactory { get; set; }

    internal InnerTaskDefinitionLogConfigurationFactory LogConfigurationFactory { get; set; }

    internal InnerTaskDefinitionFirelensConfigurationFactory FirelensConfigurationFactory { get; set; }

    internal InnerTaskDefinitionRepositoryCredentialsFactory RepositoryCredentialsFactory { get; set; }

    internal InnerTaskDefinitionLinuxParametersFactory LinuxParametersFactory { get; set; }

    internal InnerTaskDefinitionRestartPolicyFactory RestartPolicyFactory { get; set; }

    protected override Humidifier.ECS.TaskDefinitionTypes.ContainerDefinition Create()
    {
        var containerDefinitionResult = CreateContainerDefinition();
        factoryAction?.Invoke(containerDefinitionResult);

        return containerDefinitionResult;
    }

    private Humidifier.ECS.TaskDefinitionTypes.ContainerDefinition CreateContainerDefinition()
    {
        var containerDefinitionResult = new Humidifier.ECS.TaskDefinitionTypes.ContainerDefinition();

        return containerDefinitionResult;
    }
    public override void CreateChildren(Humidifier.ECS.TaskDefinitionTypes.ContainerDefinition result)
    {
        base.CreateChildren(result);

        result.HealthCheck ??= HealthCheckFactory?.Build();
        result.LogConfiguration ??= LogConfigurationFactory?.Build();
        result.FirelensConfiguration ??= FirelensConfigurationFactory?.Build();
        result.RepositoryCredentials ??= RepositoryCredentialsFactory?.Build();
        result.LinuxParameters ??= LinuxParametersFactory?.Build();
        result.RestartPolicy ??= RestartPolicyFactory?.Build();
    }

} // End Of Class

